function oldGetjsfpHwxxHtml(hwxxs, hwstr, je) {
	var hwinfo = hwxxs.split('≡');
	var hw;
	var html = "";
	for (var i = 0; i < hwinfo.length; i++) {
		hw = hwinfo[i].split('█');
		html += '<tr>';
		var tmp = "";
		for (var j = 0; j < 4; j++) {
			if (j == 1) {
				tmp = '<td class="align_right"><span class="content_td_blue">' + hw[j] + '</span></td>';
				continue
			}
			if (j == 2 || j == 3) {
				html += '<td class="align_right"><span class="content_td_blue">'
			} else {
				html += '<td class="align_center"><span class="content_td_blue">'
			}
			if (j == 0) {
				html += oldFormatHwmc(hw[j], hwstr)
			} else if (j == 1) {
				html += getzeroDot(hw[j])
			} else if (j == 2 || j == 3) {
				if (j == 2) {
					html += getzeroDot(GetJeToDot(hw[j]));
					html += tmp;
					tmp = ""
				} else {
					html += getzeroDot(GetJeToDot(hw[j]))
				}
			} else {
				html += hw[j]
			}
			html += '</span></td>'
		}
		html += '</tr>'
	}
	return html
}
