function FormatSl(data) {
	data = data.trim();
	if (parseFloat(data) < 1 && parseFloat(data) > 0 && data.substring(0, 1) != ".") {
		data = data.substring(1)
	}
	if (data.substring(0, 1) == ".") {
		data = parseFloat("0" + data) * 100;
		data = data.toString()
	}
	if (data.length > 0) {
		return data + "%"
	} else {
		return ""
	}
}
function isMoney(s) {
	var regu = "^[-]?[0-9]*(.[0-9]{1,2})?$";
	var re = new RegExp(regu);
	if (re.test(s)) {
		return true
	} else {
		return false
	}
}
function GetJeToDot(je) {
	if (!isMoney(je)) {
		return je
	}
	if (typeof(je) != "undefined" && je.trim() != "") {
		if (je.trim() == '-') {
			return je
		}
		je = je.trim() + "";
		if (je.substring(0, 1) == '.') {
			je = '0' + '.' + je.substring(1, je.length);
			if (je.split(".")[1].length == 1) {
				je += "0"
			}
			return je
		}
		var index = je.indexOf(".");
		if (index < 0) {
			je += ".00"
		} else if (je.split(".")[1].length == 1) {
			je += "0"
		}
		if (je.substring(0, 2) == '-.') {
			je = '-0.' + je.substring(2, je.length)
		}
		return je
	} else {
		return je
	}
}
